# Huffman dictionary consisting of 54 characters below
# Important! No one code can be a prefix for another code
dictionary = {
  '\n': 010100,
  '2': '010101',
  '4': '010110',
  '9': '010111',
  ':': '011000',
  'G': '011001',
  'K': '011010',
  'M': '011011',
  'V': '011100',
  'j': '011101',
  'q': '011110',
  '1': '011111',
  '6': '100000',
  'B': '100001',
  'C': '100010',
  'I': '100011',
  'W': '100100',
  'x': '100101',
  '"': '100110',
  '5': '100111',
  '8': '101000',
  'E': '101001',
  'F': '101010',
  'k': '101011',
  'R': '101100',
  'S': '101101',
  '0': '101110',
  'A': '101111',
  'L': '110000',
  '-': '110001',
  '.': '110010',
  ',': '110011',
  'v': '110100',
  'b': '110101',
  'p': '110110',
  'g': '110111',
  'w': '111000',
  'y': '111001',
  'm': '111010',
  'f': '111011',
  'u': '111100',
  'c': '111101',
  's': '111110',
  'h': '111111',
  'd': '00000',
  'l': '00001',
  'r': '00010',
  'i': '00011',
  'o': '00100',
  'a': '00101',
  'n': '00110',
  't': '00111',
  'e': '01000',
  ' ': '01001'
}

input = ''

# Important! Each value of the character is 5-6 symbols
def translate(dictionary, input)
  input_split = []
  translation = []

  input_split = input.split('')

  while input_split.length > 4
    first_five = input_split.first(5).join('')
    first_six = input_split.first(6).join('')

    if dictionary.key first_five
      translation.push dictionary.key first_five
      input_split.shift(5)
    else
      translation.push dictionary.key first_six
      input_split.shift(6)
    end
  end

  print translation.join('')
end

translate(dictionary, input)
